import React, { Component } from 'react';

class Buttons extends Component {
    state = {  }
    render() { 
        return (  
            <div>
            <button onClick={this.props.startClicked}>Order Time</button>
            <button onClick={this.props.stopClicked}>Order Time</button>
            <button onClick={this.props.handleClicked}>Order Time</button>
            <button onClick={this.props.handleClicked}>Order Time</button>
            </div>
        );
    }
}

export default Buttons ;
